    @Tag(name = "EMS")
    @Operation(summary  = "EMS 전송", description  = "EMS 전송")
    @PostMapping(value = "/ems/sendEms")
    public void send(HttpServletResponse response, @RequestBody EmsInfo emsInfo) {
        try {
            String title = null; // 메일 제목
            String html = null; // 메일 본문 (Html : 내용은 하단 메소드 참조)
            Object[] objects = null; // 메일 본문에 동적으로 대입될 값 목록
            String stats_kr = emsInfo.getStats().equals("hold") ? "보류"
                    : emsInfo.getStats().equals("complete") ? "완료"
                    : "";

            switch(emsInfo.getMailType()) {
                case "charge" :
                    title = MessageFormat.format("[중소벤처24 헬프데스크] 서비스 요청 [{0}] {1} 의 담당자가 지정되었습니다.", emsInfo.getReqTyCd(), emsInfo.getReqTitle());
                    html = charge();
                    if(!"".equals(emsInfo.getUserName()) && !"".equals(emsInfo.getReqTyCd()) && !"".equals(emsInfo.getReqTitle()) && !"".equals(emsInfo.getReqChargeName())) {
                        objects = new Object[]{emsInfo.getUserName(), emsInfo.getReqTyCd(), emsInfo.getReqTitle(), emsInfo.getReqChargeName()};
                    } else {
                        title = null;
                    }
                    break;
                case "pwdReset" :
                    title = "[중소벤처24 헬프데스크] 비밀번호 재설정 안내";
                    html = pwdReset();
                    if(!"".equals(emsInfo.getUserName()) && !"".equals(emsInfo.getTmpPwd())) {
                        objects = new Object[]{emsInfo.getUserName(), emsInfo.getTmpPwd()};
                    } else {
                        title = null;
                    }
                    break;
                case "auth" :
                    title = "[중소벤처24 헬프데스크] 회원가입이 승인되었습니다.";
                    html = auth();
                    if(!"".equals(emsInfo.getUserName()) && !"".equals(emsInfo.getAuthDate())) {
                        objects = new Object[]{emsInfo.getUserName(), emsInfo.getAuthDate()};
                    } else {
                        title = null;
                    }
                    break;
                case "stats" :
                    title = MessageFormat.format("[중소벤처24 헬프데스크] 서비스 요청 [{0}] {1} 의 처리가 {2} 되었습니다.", emsInfo.getReqTyCd(), emsInfo.getReqTitle(), stats_kr);
                    html = stats();
                    if(!"".equals(emsInfo.getUserName()) && !"".equals(emsInfo.getReqTyCd()) && !"".equals(emsInfo.getReqTitle()) && !"".equals(stats_kr)) {
                        objects = new Object[]{emsInfo.getUserName(), emsInfo.getReqTyCd(), emsInfo.getReqTitle(), stats_kr};
                    } else {
                        title = null;
                    }
                    break;
                case "comment" :
                    title = MessageFormat.format("[중소벤처24 헬프데스크] 서비스 요청 [{0}] {1} 에 메시지가 등록되었습니다.", emsInfo.getReqTyCd(), emsInfo.getReqTitle());
                    html = comment();
                    if(!"".equals(emsInfo.getReqTyCd()) && !"".equals(emsInfo.getReqTitle()) && !"".equals(emsInfo.getComment())) {
                        objects = new Object[]{emsInfo.getReqTyCd(), emsInfo.getReqTitle(), emsInfo.getComment()};
                    } else {
                        title = null;
                    }
                    break;
            }

            PrintWriter printWriter = response.getWriter();
            for(String id : emsInfo.getIdList()) {
                Optional<Member> member = memberService.getMember(id);
                String email = member.get().getEmail();
                EmsResponse result = emsClient.send(email, title, MessageFormat.format(html, objects));
                String status = result.isSuccess() ? "SUCCESS" : "FAIL";
                if(status.equals("SUCCESS")) {
                    Transmission transmission = new Transmission();
                    transmission.setRecvId(member.get().getUserId());
                    transmission.setTtl(emsInfo.getReqTitle());
                    transmission.setCnts(title);
                    transmission.setTrsmsTyCd("mail");
                    transmission.setTyCd(emsInfo.getReqTyCd());
                    transmissionService.createTransmission(transmission);
                }
                printWriter.println("<html><head><title>SmsTest Result!</title></head><body><h1>" + status + "</h1><h2>" + result.getErrorCode() + "</h2></body></html>");
            }
            printWriter.flush();
            printWriter.close();
        }
        catch (Exception ex) {
            String message = ex.getMessage();
            try {
                PrintWriter printWriter = response.getWriter();
                printWriter.println("<html><head><title>FAIL!</title></head><body><h1>" + message + "</h1></body></html>");
                printWriter.flush();
                printWriter.close();
            }
            catch (Exception exx) {
                exx.printStackTrace();
            }
        }
    }

